import React from 'react';
import styled from 'styled-components';
export const NavbarWrapper= styled.di`
      list-style-type: none;
  margin: 0;
  padding: 0;
  overflow: hidden;
  background-color: #333;
     
      li{
            display: inline;
            text-decoration:none;
            padding : 10px;
            float: right;
            
      }

`;
